import styled from 'styled-components'

export const Button = styled.button`
    width: 191px;
    height: 53px;
    left: 897px;
    top: 25px;

    font-family: Inter;
    font-style: normal;
    font-weight: bold;
    font-size: 24px;
    line-height: 29px;
    /* identical to box height */

    text-align: center;
    color: white;
    background-color: #5048E5;
`;

export const BlackButton = styled.button`
    width: 191px;
    height: 53px;
    left: 897px;
    top: 25px;

    font-family: Inter;
    font-style: normal;
    font-weight: bold;
    font-size: 24px;
    line-height: 29px;
    /* identical to box height */

    text-align: center;
    color: white;
    background-color: black;
`
